import React from 'react'
import styled from 'styled-components';

const StyledList = styled.ul`
    list-style-type: none;
    padding: 1em;
    margin: 1em 0 0 0;
`;

const StyledListTitle = styled.li`
    font-size: 0.9em;
    text-transform: uppercase;
    font-weight: bold;
    display: block;
    background: rgba(0, 0, 0, 1);
    padding: 10px 12px 10px 12px;
`;

const StyledListItem = styled.li`
    border-bottom: 1px solid #464646;
    padding: 10px 12px 10px 12px;
    background: #222;

    :last-child {
        border-bottom: none;
    }
`;

const ListView = ({ listArr }) => {
    return (
        <StyledList>
            <StyledListTitle>Videos</StyledListTitle>
            <StyledListItem>Fresh Trash</StyledListItem>
            <StyledListItem>Bucket Brigade</StyledListItem>
            <StyledListItem>Funk</StyledListItem>
        </StyledList>
    );
}

export default ListView;
